export const userSearch = createAsyncThunk("login", (user) => {  
    return axios.get("/api/login", user).then((res) => res.data);
  });


const userSearchReducer = createReducer({}, {
    [user.userSearch]: (state, action) => action.payload,
});

export default userSearchReducer;
